import React, { useState } from 'react';
import { Link } from "react-router-dom";

const DoctorLogin = (props)=>{

    const [formData, setFormData] = useState({
        password : "",
        Username : "",
    });
    
    function onSubmitClick(){
        const save= JSON.stringify(formData);
        localStorage.setItem(save);
        console.log(save);
    }
    
    
    return(
        <div>
            <p>
                <Link to="/patientlogin">Patient Login Here</Link>
            </p>            
            <h4 className="opacity-75">Doctor Login</h4>
            <form className="col-sm-30">
                <p className="opacity-50">Doctor Email ID</p>
                <input className="form-control" type="Email" placeholder="Enter Email ID" onChange={event => setFormData({...formData,Username: event.target.value})}/><br/>
                <p className="opacity-50">Doctor Password</p>
                <input className="form-control" type="password" placeholder="Enter Password" onChange={event => setFormData({...formData,password : event.target.value})}/><br/>
                <div>
                    <button type="Submit" onClick={onSubmitClick} className="btn btn-primary">SUBMIT</button>
                </div>                               
            </form>
            <br/>
            <Link to="/doctorRegistration">New Doctor ? Reg. Here</Link>
                       
        </div>
    );
}

export default DoctorLogin;
